import React, {Component} from "react";
import City from "./city.js";
import "./map.scss";


class Map extends Component {
    render() {
        return (
            <div className="map-wrapper">
                <div className="map">
                 <City top="150px" left="225px" name="Warszawa"/>
                 <City top="150px" left="100px" name="Poznań"/>
                 <City top="150px" left="200px" name="Wrocław"/>
                 <City top="150px" left="200px" name="Łódź"/>
                 <City top="150px" left="200px" name="Katowice"/>
                 <City top="150px" left="200px" name="Kraków"/>
                 <City top="150px" left="200px" name="Trójmiasto"/>
                 <City top="150px" left="200px" name="Szczecin"/>
                 <City top="150px" left="200px" name="Białystok"/>
                 <City top="150px" left="200px" name="Rzeszów"/>
                </div>
            </div>
        )
    }
}

export default Map;
